INSERT INTO `article` VALUES (7,'SPACE','In 2011, NASA dropped jaws when it introduced its giant, heavy-lift rocket, the Space Launch System as the future go-to booster for U.S. missions into deep space. The agency wants to send astronauts into deep space aboard its four-passenger Orion Multi-Purpose Crew Vehicle. The SLS will stand at 403 feet (122 meters) from top to bottom, and will weigh over 6 million pounds when fueled. Armed with five liquid-fueled engines and two solid-fueled boosters, the SLS ability to produce of 8.8 million pounds of thrust at liftoff will be on par with that of 160,000 Corvette engines. It boasts approximately 10-20 per cent more thrust than the Apollo Mission-era Saturn V, the biggest and most powerful rocket until now.  The top of the SLS will hold the Orion Multi-Purpose Crew Vehicle, carrying it beyond low orbit and past the moon, launching it into deep space before returning to the Earth surface. With the SLS, NASA has planned for astronauts to visit asteroids in the 2020s. And we could begin the first human exploration of Mars in the 2030s.','Ankit Rathore','2017-11-08',140,'NASA Is Building The Most Powerful Rocket of All Time','https://dw8stlw9qt0iz.cloudfront.net/JPXTkAWyi1i5LpPdHVtwPqJ-7n0=/fit-in/800x450/filters:format(jpeg):quality(75)/curiosity-data.s3.amazonaws.com/images/content/landscape/standard/fda40e0a-d6be-477c-8339-9284ee0d7ea3.png',1),(14,'SPACE','Only 18 people (14 NASA astronauts) have lost their lives in the history of spaceflight. That\'s not a lot, considering how many huge unknowns are part of space exploration. In each of these deadly instances, there were no survivors. But...what if there had been? NASA has no official protocol on what to do with a corpse in space. \'I did quite a bit of medical training to save people, but not for this,\' ISS and shuttle astronaut Terry Virts told Popular Science. \'In my 16 years as an astronaut, I don\'t remember talking with another astronaut about the possibility of dying.\'','Ankit Rathore','2017-12-07',43,'NASA Has No Protocol For What To Do With A Dead Body In Space','https://dw8stlw9qt0iz.cloudfront.net/oQjv0PpBNySI-yZ2mx_g1wIIjLk=/fit-in/800x450/filters:format(jpeg):quality(75)/curiosity-data.s3.amazonaws.com/images/content/landscape/standard/9726fa57-cd48-4875-c161-b5eff53a6936.png',1),(15,'SPACE','The United Nations Office for Outer Space Affairs (UNOOSA) was originally established in 1958. In 2021Ã¢??more than 60 years laterÃ¢??it will launch its first space mission. The focus of the mission is to give developing nations, many of which don\'t have a dedicated space program, a chance to put scientific experiments in microgravity. The mission will rely on the Sierra Nevada Corporation\'s Dream Chaser spacecraft, a reusable, airplane-like shuttle that can land at an ordinary airport upon its return. The flight will last 14 days, and while it\'s meant for developing countries, any United Nations member state can apply to include its own payload. The U.N. may seem like an unlikely organization to be planning a space mission, but the project lines up with its principles rather well. \'One of UNOOSA\'s core responsibilities is to promote international cooperation in the peaceful use of outer space,\' UNOOSA director Simonetta Di Pippo said in the project\'s press release. The U.N. will offer technical support to the countries who apply, along with financial assistance through a variety of sponsors. The hope is that this mission will go even further toward making outer space a place where countries can put aside their differences and collaborate as citizens of Earth. Learn more about the mission in the videos below.','Ankit','2017-12-08',0,'The U.N.s First Space Mission Launches In 2021','https://i.ytimg.com/vi/lt0WQ8JzLz4/maxresdefault.jpg',1),(16,'SPACE','Less Gravity Makes For Lazier Hearts. Gym buffs know you lose muscle mass when you don\'t work out regularly. Same goes for a heart in microgravity. \'The heart doesn\'t work as hard in space, which can cause a loss of muscle mass,\' said James Thomas, M.D., ultrasound lead at NASA, in an American College of Cardiology news release. For the study, 12 astronauts learned how to do ultrasounds so they could image their hearts before, during and after space travel. The NASA researchers found that their hearts became 9.4 percent more spherical, which could be a sign the muscle is not working as efficiently. Luckily, their hearts returned to their normal shapes once they were back on Earth, but the effects a longer spaceflight could have are anyone\'s guess. There\'s a silver lining in all of this. The study not only tested what microgravity does to hearts in spaceÃ¢??it also tested sophisticated mathematical models that the researchers had developed to predict what the hearts might do. The final results matched what their models had predicted, which means that they might be able to use them to predict what other, more earthly elements might do to the heart. It gives us confidence that we can move ahead and start using these models for more clinically important applications on Earth, such as to predict what happens to the heart under different stresses, said Thomas, also of Northwestern Medicine, in the 2014 release. That means the astronauts\' heart images could eventually help scientists learn more about cardiac conditions that affect people on this planet.','Ankit','2017-12-08',0,'Space Travel Changes The Shape of Astronauts\' Hearts','https://dw8stlw9qt0iz.cloudfront.net/XfbgcUUPnNKz1YwmO2LwPZwf2j4=/fit-in/800x450/filters:format(jpeg):quality(75)/curiosity-data.s3.amazonaws.com/images/content/landscape/standard/d36b24b2-70fe-4a19-b132-9956df3e0736.png',1),(17,'SPACE','They say that in space, no one can hear you scream. It\'s true Ã¢?? space is a vacuum, and sound waves need an atmosphere to be heard. So technically, in space, no one can hear you do anything. But astronomers still use sound to make a whole range of observations, and the sounds they hear can only be described as otherworldly. Space looks empty, but it\'s actually abuzz with activity. If your eyes worked at the quantum level, you\'d see all sorts of particles whipping around in the form of light, solar wind, and cosmic radiation. If they were in Earth\'s atmosphere, those particles would make quite a racket, but in space, we can only identify their existence with specialized detectors that record the particular frequencies at which they vibrate and spin and ricochet through the void. But once they have the data, scientists will often turn those frequencies into ones we can hear. Why? Because our sense of hearing is surprisingly sharp. \'The auditory system is the best pattern-recognition device that we know of,\' Georgia Institute of Technology professor Bruce Walker told Scientific American. \'If you\'re looking through a data set and trying to understand what\'s going on, it\'s often easier and more efficient to listen to the sound of it rather than looking at a screen or a printed version.\'','Ankit','2017-12-08',0,'The Sounds Of Space Teach Us More About The Universe','https://dw8stlw9qt0iz.cloudfront.net/qIyj4OECEtEgerOVRZ9EqTdirhc=/fit-in/800x450/filters:format(jpeg):quality(75)/curiosity-data.s3.amazonaws.com/images/content/landscape/standard/80d49d22-ce4a-464d-e891-c479cf44735e.png',1);
